import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';

const ToDo = (props)=>{
    return(
        <>
        <div className="todoStyle">
        <span 
        id="listB" 
        className='btn_align' 
        onClick={()=>{
            props.onselect(props.id)
         }}>

         <DeleteIcon className="DeletItem"
         />
         </span>
         
         <li> 
         <span 
        id="listB" 
        className='btn_align' 
        onClick={()=>{
            props.onselect(props.id)
         }}>

         <DeleteIcon className="DeletItem"
         />
         </span>
          {props.text}</li> <br/>
        
       
        </div>

        </>
    )
}

export default ToDo;
